(40, 'Red Nacional de Refugios (RNR).', 'Es una organización civil que agrupa y coordina una red de refugios y centros de atención externa para mujeres, sus hijas e hijos, en situación de violencia extrema. Ofrecen alojamiento seguro, alimentación, atención psicológica, asesoría jurídica, talleres de empoderamiento y acompañamiento para la construcción de una vida libre de violencia.', '800 822 44 60', );
INSERT INTO `organizaciones` (`id`, `nombre`, `descripcion`, `numero`, `imagen`) VALUES
(41, 'Instituto Nacional de las Mujeres (Inmujeres).', 'El organismo de la administración pública del Gobierno de la Ciudad de México responsable de lograr que se garantice la protección y ejercicio pleno de los derechos humanos de las mujeres y las niñas, para erradicar la discriminación y alcanzar la igualdad sustantiva.', '55 5322 6030', );
INSERT INTO `organizaciones` (`id`, `nombre`, `descripcion`, `numero`, `imagen`) VALUES
(43, 'Comisión Nacional para Prevenir y Erradicar la Violencia Contra las Mujeres (CONAVIM)', 'Es un órgano desconcentrado de la Secretaría de Gobernación (SEGOB) del Gobierno de México. Su función principal es diseñar, coordinar y ejecutar la política nacional para prevenir, atender, sancionar y erradicar la violencia contra las mujeres. Aunque no brindan atención directa en refugios, son clave en la coordinación de los esfuerzos institucionales y la promoción de leyes y políticas públicas.', 'S/N', ),
(44, 'Fundación Origen', 'Es una fundación que se enfoca en apoyar a mujeres en situación de vulnerabilidad, incluyendo aquellas que han experimentado violencia. Ofrecen líneas de ayuda telefónica, atención psicológica, asesoría legal y talleres de desarrollo personal y empoderamiento económico, con un enfoque en la reconstrucción de la vida de las mujeres.', '800 00 674436', ),
(45, 'Fondo Semillas', 'Es una organización feminista que apoya económicamente a organizaciones de base en México que trabajan por los derechos de las mujeres, incluyendo aquellas que abordan la violencia de género. Si bien no brindan atención directa a víctimas, su apoyo financiero es fundamental para que muchas organizaciones locales puedan ofrecer servicios de refugio, asesoría y acompañamiento a mujeres en situación de violencia.', 'S/N', );
INSERT INTO `organizaciones` (`id`, `nombre`, `descripcion`, `numero`, `imagen`) VALUES
(46, 'Consejo Nacional Para Prevenir la Discriminación (Conapred).', 'Contribuir a que toda persona ejerza, sin discriminación, todos los derechos y libertades consagrados en el orden jurídico mexicano. Consolidarnos como la institución rectora que coloque en el centro de la agenda nacional el respeto al derecho a la igualdad y no discriminación.', '800 543 0033', );

